Count the number of occurence of a nested field<p>I am trying to count the number of documents with a matching criteria in a nested field.</p>

<p>My schema is defined as follows:</p>

<pre><code>let userSchema = new Schema({
  //...
  interests: [{
    type: Schema.Types.ObjectId,
    ref: 'Interests'
  }],
  //...
});

let interestSchema = new Schema({
  id: ObjectId,
  name: {
    type: String,
    required: true
  },
  //...
});
</code></pre>

<p>The count must reflect how many times an interest with the same name is choosed by the users.</p>

<p>For example, I must have a result of 2 with the interest 'coding' in the following documents:</p>

<pre><code>{
  //Other Fields of user 1
  "interests": [
     {
       "id": "XXX"
       "name": "coding"
     }, 
     {
       "id": "YYY"
       "name": "surfing"
     }]
}

{
  //Other Fields of user 2
  "interests": [
     {
       "id": "ZZZ"
       "name": "coding"
     }
   ]
}
</code></pre>

<p>I looked into the <a href="http://mongoosejs.com/docs/api.html#model_Model.countDocuments" rel="nofollow noreferrer">countDocuments</a> method, but it doesn't seem to allow this kind of count.</p>

<hr>

<p><strong>EDIT + First solution:</strong></p>

<p>This is how I managed to solve it:</p>

<pre><code>const res = await UserModel.aggregate([
  {
    $unwind: '$interests'
  },
  {
    $lookup: {
      from: "interests",
      localField: "interests",
      foreignField: "_id",
      as: "interests"
    }
  },
  {
    $match:{
      "interests.name": name
    }
  },
  {
    $count: "count"
  }
]);
return res[0].count;
</code></pre>

<p>The fact that the interests is a referenced type, I can not query for its name unless I pass the <code>lookup</code> stage. I am not sure if this is a good solution regarding performance, since the <code>unwind</code> stage must pass through all the users of the database and create a new element for each of their interests. This why I am not posting it as an answer</p>

