Updating deeply embedded documents with MongoDB 2.6.12<p>I am using MongoDB 2.6.12 and need to update deeply embedded docs. I know that I cannot use the latest solution at <a href="https://jira.mongodb.org/browse/SERVER-831" rel="nofollow noreferrer">https://jira.mongodb.org/browse/SERVER-831</a>, so I need to find the index of each doc and subdoc. I have done this and can update a single document using robomongo (yes, I still use this), like so:</p>

<pre><code>db.getCollection('Ps').update({'dT.name': 'something', pid: 220 }, { '$set': { 'dT.0.ts.0.th': 90}})
</code></pre>

<p>However, when I run the following in my node script, I see the mongoose queries in the terminal, but nothing changes in the db:</p>

<pre><code>let main = async function() {
let ps = [];
try {
    ps = await data.app.Ps.find({"dT.ts.th":{"$lte":1}}).exec();
} catch (e) {
    console.log(e);
}

try {
    for (let p of ps) {
        p.dT.forEach(async function(dT, index) {
            dT.ts.forEach(async function(type, i) {
                let newValue = type.th * 100;
                await data.app.db.collection("Ps").update(
                    {pid: p.pid, "dT.name": dT.name},
                    {$set: {["dT." + index +".ts." + i + ".th"]: newValue}}
                ).exec();
            });
        });
    }
} catch (e) {
    console.log(e);
}
};

main()
.then(() =&gt; process.exit())
.catch((e) =&gt; console.log(e));
</code></pre>

<p>This in example of the query I see being executed when my script runs:</p>

<pre><code>Mongoose: ps.update({ 'dT.name': 'activity', progId: 220 }, { '$set': { 'dT.1.ts.0.th': 90, updatedAt: new Date("Thu, 19 Jul 2018 16:00:50 GMT"), createdAt: new Date("Thu, 19 Jul 2018 16:00:50 GMT") } }, { overwrite: true })
</code></pre>

<p>Does anyone have any ideas why a single query works in robomongo and not dynamically in a node script?</p>

<p><strong>UPDATE</strong></p>

<p>I changed the following code in my snippet above:</p>

<pre><code>await data.app.db.collection("Ps").update(
    {pid: p.pid, "dT.name": dT.name},
    {$set: {["dT." + index +".ts." + i + ".th"]: newValue}}
).exec();
</code></pre>

<p>To:</p>

<pre><code>console.log("Before: " + p.dT[index].ts[i].th);
p.dT[index].ts[i].set("th", newValue);
console.log("After: " + p.dT[index].ts[i].th);
p.save(function (error, result) {
   console.log("here");
});
</code></pre>

<p>My console messages show that the program attribute is being changed, but I don't see any mongoose queries in the terminal. I believe this should work per the document at <a href="http://mongoosejs.com/docs/faq.html" rel="nofollow noreferrer">http://mongoosejs.com/docs/faq.html</a>. It is not, so what's going on?</p>

