<blockquote>
  <p>[{ property: 'Color', value: 'Black' }, { property: 'Length', value: '1 inch' }]</p>
</blockquote>

<p>Each product has a random amount of properties. The problem is that I can't lookup a product and get their properties with its identifier.</p>

<p>Below is the product schema.</p>

<pre><code>const mongoose = require('mongoose');

let product = new mongoose.Schema({
    id: { type: mongoose.Schema.Types.ObjectId },
    created_at: { type: Date, default: new Date()},
    language: { type: String, required: true },
    category: { type: String },
    articlenumber: { type: String },
    name: { type: String },
    properties: { type: [{}] }
});

