Meteor use MongoDB-collection with array of objects that already exists<p>I made a python script that reads a file and creates a new mongoDB collection.
The collection is as follows, when I print one document of the collection in python:</p>

<pre><code>{'_id': '5b5b0a55ca902423007413b9',
 'employee': 'John Doe',
 'schedule': [{'date': '08/11/2018', 'project': 'Drawing'},

                                     ... 

               {'date': '05/06/2018', 'project': 'Teaching'}
             ]
}
</code></pre>

<p>I made a collection in meteor using this code:</p>

<pre><code>Planning = new Meteor.Collection("Planning");
</code></pre>

<p>Planning is also the name I gave the collection in python.
Now when I run this code in Meteor (server side):</p>

<pre><code>Meteor.methods({
    getFullPlanning: function(){
        var one = Planning.find({ employee: 'John Doe'});
        console.log(one.employee);  
    }
});
</code></pre>

<p>This piece of code logs undefined, but there is an employee with that name in my collection. What am I doing wrong in Meteor?</p>

<p>But this does work:</p>

<pre><code>Planning.find().count() // = 53 which is correct!
</code></pre>

